import "../Css/LinkHero.css";
import { url } from "inspector";

export default function LinkHero (props) {
    return(
        <div className="LinkHero" style={{backgroundImage: url(props.image)}}>
            <h1>{props.title}</h1>
            <h1>{props.desc}</h1>
        </div>

    )
}
